import numpy as np
from numpy import linalg as LA

from discreteMarkovChain import markovChain
from kronprod import *


def fullKronProd(P,Q):
    PQ=np.zeros((len(P)*len(Q),len(P)*len(Q)))
    
    n=len(Q)
    for l in range(len(Q)):
        for k in range(len(Q)):
            for j in range (len(P)): 
                for i in range (len(P)):
                    PQ[k+n*l][i+n*j]=P.item((k, i))* Q.item((l, j)) 
    return PQ


# Target states -- diagonal states of final Markov chain
# n is dimension of both agent's state spaces
def twoAgentHittingSet(n,p):
    hittingset = []
    diag = 0
    for i in range(n*n):
        if i == diag*n + diag:
            hittingset.append(i)
            diag += 1
    return hittingset

# n is size of spatial discretiztion
# k is size of angle discretization
# i is state in joint two-agent state space
# i = (robot1state)*n + (robot2state)
# robot2state = i % (n)
# robot1state = (i-robot2state) / n
#
# robotistate = (xcoord) + (ycoord)*n + thetacoord*(n^2)
# xcoord = robotistate % n
# ycoord = (robotistate - xcoord)/n % n
# thetacoord = (robotistate - xcoord - ycoord*n)/n**2

def unpackCoords(robot, n):
    x = robot % n
    y = (robot - x)/n % n
    theta = (robot - x - y*n)/n**2
    return (x,y,theta)

def unpackGeom(i,n):
    robot2 = i % n
    robot1 = (i-robot2)/n
    return unpackCoords(robot1, n), unpackCoords(robot2, n)

# return Bool, resulting assembly id, and orientation

# x1 x2 -> xx, xy = x1, th= 0
def one_one_hitting(i,n):
    (x1,y1,th1), (x2,y2,th2) = unpackGeom(i,n)
    if y1-y2 == 0:
        if x1-x2 == 1:
            return True, 2, 0
        elif x1-x2 == -1:
            return True, 2, 2
        else:
            return False, False, False
    elif x1-x2 == 0:
        if y1-y2 == -1:
            return True, 2, 3
        elif y1-y2 == 1:
            return True, 2, 1
        else:
            return False, False, False
    else:
        return False, False, False


# approximate hitting sets
# underapproximates... misses this case and similar ones:
# . x  x2
# . x1 .
# . .  .
def one_two_hitting(i,n):
    (x1,y1,th1), (x2,y2,th2) = unpackGeom(i,n)
    if y1-y2 == 0:
        if abs(x1-x2) == 1:
            if th2 == 0 or th2 == 2:
                return True, 3, 0 # straight line 3
            else:
                return True, 4, 0 # L shape 3
        else:
            return False, False, False
    if x1-x2 == 0:
        if abs(y1-y2) == 1:
            if th2 == 0 or th2 == 2:
                return True, 4, 0
            else:
                return True, 3, 0
    else:
        return False, False, False

# pass in list of nxn matrices
def hittingtime(Mlist):
    #Plist = [np.array(markovChain(m).getTransitionMatrix()) for m in Mlist]
    Plist = Mlist
    A = KronProd(Plist)

    hittingset = twoAgentHittingSet(A.n[0], len(Plist))
    print(hittingset)

    one = np.ones(A.N)
    one[hittingset] = 0

    mask = np.zeros(A.N)
    for i in range(A.N):
        if i in hittingset:
            mask[i]=1

    k1 = np.zeros(A.N)
    k2 = one + A.dot(k1)

    while(LA.norm(k1-k2)>1e-6):
        k1=k2
        k2 = one + A.dot(k1)
        np.putmask(k2, mask, 0)
        #print("Iteration",i)
        #print(LA.norm(k1-k2))

    print('Hitting Time',k2)

    return k2

